import { Composite, Bodies } from 'matter-js'

const SecondFloor = (screen) => {
  var floorTwoComposite = Composite.create();

  var secondGround = Bodies.rectangle(screen.w / 2, 2 * screen.h, screen.w, 200, {
    isStatic: true,
    collisionFilter: {
      group: -1
    }
  });
  var leftGround = Bodies.rectangle(0.25 * screen.w, 0.55 * screen.h, screen.w * 0.5, screen.h * 0.05, {
    isStatic: true,
    collisionFilter: { group: -3 }
  });

  var rightGround = Bodies.rectangle(0.75 * screen.w, 0.55 * screen.h, screen.w * 0.5, screen.h * 0.05, {
    isStatic: true,
    collisionFilter: { group: -3 },
  });

  Composite.add(floorTwoComposite, secondGround);

  return floorTwoComposite;
}

export default SecondFloor;
